import "./App.css";
import "./styles.css";
import { BrowserRouter as Router, Route, Routes  } from 'react-router-dom';

import NewListing from "./page/NewListing";
import PendingListing from "./page/PendingListing";
import CompletedListing from "./page/CompletedListing";

function App() {
  return (
    <Router>
      <Routes >
        <Route path="/new" element={<NewListing/>}  />
        <Route path="/pending" element={<PendingListing/>} />
        <Route path="/completed" element={<CompletedListing/>} />
      </Routes >
    </Router>
  );
}

export default App;
